import React from "react";
import Particles from 'react-particles-js';
import Paper from '@material-ui/core/Paper';
import "../App.scss";

import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import Grid from '@material-ui/core/Grid';



import Title from "../components/title";
import { createMuiTheme, makeStyles, ThemeProvider } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
  small: {
    width: theme.spacing(3),
    height: theme.spacing(3),
  },
  large: {
    width: theme.spacing(15),
    height: theme.spacing(15),
    textAlign: "center",
    display: "block",
    justifyContent: "center",
    alignItems: "center",
    margin: "auto",
  },
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));



const Home = () => {
  const classes = useStyles();
  return (
    <div className='inner'>
      <div class="content-div" outlined={3} >
      <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
        <Avatar alt="Remy Sharp" src="https://avatars0.githubusercontent.com/u/20913134?s=460&u=d63eedfa2a962142141c913bc888c5962785fe2e&v=4" className={classes.large} />
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper className={classes.paper}>xs=12 sm=6</Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper className={classes.paper}>xs=12 sm=6</Paper>
          <Button variant="outlined">Default</Button>
        </Grid>
        <Grid item xs={6} sm={3}>
          <Paper className={classes.paper}> <Button variant="outlined">Default</Button></Paper>
          <Button variant="outlined">Default</Button>

        </Grid>
        <Grid item xs={6} sm={3}>
          <Paper className={classes.paper}>xs=6 sm=3</Paper>
          <Button variant="outlined">Default</Button>

        </Grid>
        <Grid item xs={6} sm={3}>
          <Button variant="outlined">Default</Button>
        </Grid>
        <Grid item xs={6} sm={3}>
          <Button variant="contained">Default</Button>
        </Grid>
      </Grid>
    </div>

    </div>
    </div>
  );
};

export default Home;
